'));      }    }  }  function wrap(el, wrapper) {    wrapper.className = "gallery-photo";    el.parentNode.insertBefore(wrapper, el);    wrapper.appendChild(el);  }  //相册瀑布流  let galleryPhotos = document.querySelectorAll('.gallery-photos') || ''  if(galleryPhotos){    imgStatus.watch('.gallery-photo img', function(imgs) {      if(imgs.isDone()){        for(var i=0;i < galleryPhotos.length;i++){          waterfall(galleryPhotos[i]);          let pagePhoto = galleryPhotos[i].querySelectorAll('.gallery-photo');          for(var j=0;j < pagePhoto.length;j++){pagePhoto[j].className += " visible"};        }      }    });    window.addEventListener('resize', function () {      for(var i=0;i < galleryPhotos.length;i++){        waterfall(galleryPhotos[i]);      }    });  }});</script><gallery><img src=https://pic3.zhimg.com/v2-2308403ec9015818490e6a2d145db572_r.webp><br><img src=https://pic3.zhimg.com/v2-aba3f590c0b3c855b4f466d5947dc5b6_r.webp><br><img src=https://pic3.zhimg.com/v2-ae72c77ccfcae4c21fe01a6311a5873a_r.webp><br><img src=https://pic3.zhimg.com/v2-a365c98447e44bce839c8c2d1a949d2a_r.webp><br><img src=https://pic2.zhimg.com/v2-9b4c1eed7987f0dc6725f95ac36512cd_r.webp><br><img src=https://pic3.zhimg.com/v2-7a954e88b40a18d451120a3bc110e606_r.webp><br><img src=https://pic4.zhimg.com/v2-fe0fc87e69f0eda379fc3a1efe71b1b3_r.webp><br><img src=https://pic2.zhimg.com/v2-480d3a492e463f5e12a72618589a2e65_r.webp><br><img src=https://pic4.zhimg.com/v2-b7b798d1e66e53bfbc2d63a1cfb10f93_r.webp><br><img src=https://pic1.zhimg.com/v2-5586833ecd2de0d2c71700785d2af718_r.webp><br><img src=https://pic3.zhimg.com/v2-7b1f2efbc6e789c1bfc90d9d27132072_r.webp><br><img src=https://pic3.zhimg.com/v2-d9ef5ef93769b1f0ba021d4b78b225c6_r.webp><br><img src=https://pic3.zhimg.com/v2-74c2f5fa357fda443f569a91cb62b7e6_r.webp><br><img src=https://pic4.zhimg.com/v2-0b4b9a449a0d4e81293edda25c2d8ee3_r.webp><br><img src=https://pic3.zhimg.com/v2-4d93f55ba7b40c27a7
